import React from 'react';
import { Box, Button, Typography } from '@mui/material';
import { ReactTyped } from 'react-typed';
import ParticlesComponent from './particles/particlesComponent';
import './particles/particles.css'
import './styles/home.css'; 
import '../App.css';

const HomeText = () => {
	return (
		<div className='home_text_container'>
      <div className='home_text'>
        <p className="header-introduction_text"> Hey, I'm </p>
        <p class="header-introduction_name"> Nelson Rodriguez </p>

        {/**<Typewriter 
          text={"The quick brown fox jumps over the lazy dog"} 
          delay={100} 
          infinite={true}
        />**/}

        <ReactTyped 
          strings={[
            "Software Engineer and Developer with an eye for Design Developer with an eye for Design",
            "Algorithms Expert and Problem Solver Developer with an eye for Design",
            "CS Alumni and Ramblin Wreck from Georgia Tech Developer with an eye for Design",
            "Currently learning AI/ML in my free time Developer with an eye for Design",
            "Hardware Enthusaist and Coffee Connosieur",
            "Avid Runner, Passionate Gamer, and Animal Lover",
          ]} 
          typeSpeed={50} 
          backDelay={2000}
          cursorChar='|'
          loop={true}
          className='header-introduction-typer'
        />

        <ParticlesComponent id='home_particles_component'/>

        {/** About me button */}
        <Box className="about_me" sx={{margin: '30px 0', position: 'absolute'}}>
          <Button variant='outlined'size='large' onClick='/scrollToAboutMe' color='inherit'
            sx={{
              backgroundColor: 'var(--primary-color-dark)',
              color: 'var(--primary-color-light)', 
              '&:hover': {
                backgroundColor: 'white', 
                color: 'black'
              },
              fontFamily: 'var(--font-family-ibm-plex-mono)', 
              textTransform: 'none', 
            }}>
            <Typography variant='h6' align='center' fontWeight={300}>
              About Me!
            </Typography>
          </Button>

        </Box>

      </div>
    </div>
	)
}

export default HomeText;
